z-index: 700;
left: 0;
    height: 80px;
    background: #0f0f0f;

    @media (min-width: 1024px) {
        z-index: 800;
    }
`;

const Player = (props) => {
    return (
        <Element>Ok</Element>
    );
}

export default Player;
